import { Sky } from '@react-three/drei'

export default function Firmament(props) {
  return (
    <Sky
      turbidity={6}
      distance={6000} // Camera distance (default=450000)
      sunPosition={[90000, 6000, 0]} // Sun position normal (defaults to inclination and azimuth if not set)
      inclination={0} // Sun elevation angle from 0 to 1 (default=0)
      elevation={0}
      exposure={0}
      mieDirectionalG={0.3}
      rayleigh={0.4}
      azimuth={0.5} // Sun rotation around the Y axis from 0 to 1 (default=0.25)
      {...props} // All three/examples/jsm/objects/Sky props are valid
    />  )
}
